import React from "react";

const Contact = () => {
  return (
    <>
      <div className="my-5 text-center font-weight-bold">
        <h1>Reach to us in case of any issue</h1>
      </div>
      <div className="container-fluid nav_bg">
        <div className="row">
          <div className="col-10 mx-auto">
            <div className="row">
                <div className="col-md-6 col-10 mx-auto"></div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};
export default Contact;
